{"Text Review": "I have all the plants/aku sudah punya semua tanaman Level max Please add something new/mohon tambahkan hal baru Like plants, world, pinata, And power ups/seperti tumbuhan, dunia, pinata, dan power ups And if you can, can you add new mint? /dan jika kamu bisa apakah kamu bisa menambahkan mint baru? Thank you/terima kasih This is my fav game/ini game favorit saya Info game: Halo selamat datang ke plant vs zombies 2! Mulai ada update yang namanya shadow peashooter, battleZ, dan Buff & BrUIzes Yap shadow peashooter? Yah plant baru disini Dia bisa mengeluarkan laser hitam yang bisa melambatkan zombie jika diletakkan dekat moonflower. Jika serangan biasa maka akan mengeluarkan pea berbentuk hitam tapi tidak ada efeknya. Juga ketika kasih plant food power (didekat moonflower) akan menimbulkan ledakan yang besar dan damage luar biasa BattleZ: Battle z adalah pertarungan player dengan player lain (multiplayer) Yang bertarung mengalahkan skor lawan dengan membunuh zombie. Semakin banyak zombie yang anda bunuh, semakin banyak zombie yang muncul dan skor yang kalian dapatkan. Jika zombie jaraknya jauh dengan kita maka akan mendapatkan skor bonus. Dan kita bisa mendapatkan diamond dan mint di sini Buffs & BrUIZes Buffs and bruizes adalah efek tanaman tertentu Contohnya keluarga Fila mint Fila mint menyerang zombie kemungkinan kuat, lemah, ataupun tidak ada efek kepada zombie Hot date event!! Quest hot date, anda akan mendapatkan sebagian seed packets hot date dan pembelian pack hot date Lawn of doom!!!!! Pembelian pinata lawn of doom akan mendapatkan Witch hazel Jack o'lantern Ghost pepper Hot date Shadow peashooter Shadow shroom Grimrose. Community challenge!!!! Anda akan mendapatkan pinata lawn of doom disini jika menyelesaikan tantangan ini. Hai, teman teman petani!ada kesalahan di plant vs zombies kamu? Ya bagi yang mau tahu solusinya ya ini solusinya yang kalian bingung: 1 tidak bisa masuk game? Tinggal saja matikan internet connection kamu. 2 seed packet saya sedikit bagaimana cara membelinya? Hidupkan internet connection kamu dan pergi ke toko untuk membeli beberapa seed packet. Setiap hari seed packet berbeda beda(membeli memakai coin) 3 kenapa game saya lambat? Mungkin karena memorinya agak penuh kosongkan memorimu", "Rating": "5", "Tanggal": "3 November 2018", "Nama User": "hacks dragon gaming"}
